Blockly.Msg.TOUR1_DESCRIPTION01 = "Benvenuto, fai clic su »successivo« e inizia un tour attraverso Open Roberta Lab. <br> Ti mostrerò come programmare il tuo robot con NEPO. <br> Puoi terminare questo tour quando vuoi premendo su »X« nell'angolo in alto a destra.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "il menu ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "qui puoi trovare tutto il necessario per programmare il robot! <br> <span class = 'typcn typcn-document-text \"> </span> Salva e carica i programmi <br> <span class =\" typcn typcn-ev3 \"> </span> Collega il tuo robot a Open Roberta Lab o passa a un altro sistema <br> <span class = \"typcn typcn-lightbulb\"> </span> Aiuto per tutti i tipi di problemi <br> <span class = \"typcn typcn-user \"> </span> Tutto sugli account utente, ad es. login o disconnessione <br> <span class =\" typcn typcn-th-large-outline \"> </span> Guarda la gallery e prova grandi programmi da altri utenti! <br> <span class = \"typcn typcn-world\"> </span> Fai clic qui per passare a un'altra lingua";
Blockly.Msg.TOUR1_DESCRIPTION04 = "clicca qui e passare alla configurazione del robot";
Blockly.Msg.TOUR1_DESCRIPTION05 = "se hai costruito un altro robot <br> qui puoi adattarne la configurazione. <br> Se non hai un robot e vuoi testare il tuo programma nella simulazione <br> questa configurazione verrà applicata.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "clicca qui e passa di nuovo alla zona di programmazione!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "la casella degli strumenti. <br> qui si possono trovare tutti i blocchi di programmazione.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "una volta che sei un utente esperto, puoi passare qui alla modalità esperto della casella degli strumenti. <br> Troverai quindi più blocchi per programmare il tuo robot. <br> <span class = 'typcn typcn-media-stop-outline \"> </span> modalità principiante <br> <span class = \"typcn typcn-star-outline\"> </span> modalità esperto";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Ogni programma inizia con il programma «» Inizia blocco. <br> maggiori blocchi di programmazione, che il robot deve eseguire, devono essere allegate a questo blocco <br>. Proprio Drag'n cadere il diritto blocco desiderato sotto il blocco di partenza.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "ecco alcune scorciatoie! <br> Da sinistra a destra: <br> <span class = 'typcn typcn-media-play \"> </span> Fai clic qui per eseguire il programma sul robot reale <br> <span class = \"typcn typcn-cloud-storage\"> </span> Salva il tuo programma, ma prima devi accedere <br> <span class = \"typcn typcn-zoom\"> </span> Fai clic qui e ingrandisci i blocchi, se vuoi <br> <span class = \"typcn typcn-archive\"> </span> Il cestino! Basta spostare i blocchi nel cestino e verranno eliminati. <br> & nbsp; & nbsp; & nbsp; & nbsp ; & nbsp; & nbsp; Attenzione: non puoi recuperare i blocchi una volta eliminati! <br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "clicca su »Azione«";
Blockly.Msg.TOUR1_DESCRIPTION12 = "ora trascina il nuovo blocco appena sotto il blocco AVVIO PROGRAMMA in modo che siano collegati";
